import React, { Component } from 'react';
import { Card, Container, Form, Button, Row, Col, Table } from 'react-bootstrap';
import { withRouter } from "react-router-dom";
import axios from 'axios';

class ListCarriers extends Component {
    constructor(props) {
        super(props);
        this.state = {
            ListCarriers: [],
            fields: {userName:''},
        }
    }

    componentDidMount() {
        axios.get(`http://localhost:8082/api/v1/carriers/listcarriers`, '').then(res => {
            if (res && res.data && res.data.success) {
                this.setState({ ListCarriers: res.data.output });
                console.log("res", res.data.output);
            }
        })
    }

    render() {
        return (
            <Container fluid>
                <Card>
                    <Card.Body>

                        <Col md={4}>
                            <Form.Group className="mb-3">
                                <Form.Label>Username</Form.Label>
                                <Form.Control type="text" placeholder="Enter username" id="userName" name="userName" value={this.state.fields.userName} onChange={(e) => { this.handleOnChange(e) }} required />
                                <Form.Control.Feedback type="invalid">
                                    Please enter a username.
                                </Form.Control.Feedback>
                            </Form.Group>
                        </Col>

                        <Card.Title>List Carriers</Card.Title>
                        <Row>
                            <Table striped hover size="sm">
                                <thead>
                                    <tr>
                                        <th><b>name</b></th>
                                        <th><b>nickname</b></th>
                                        <th><b>code</b></th>
                                        <th><b>accountNumber</b></th>
                                        <th><b>balance</b></th>
                                        <th><b>shippingProviderId</b></th>
                                    </tr>
                                </thead>
                                <tbody>
                                    {this.state.ListCarriers.map((prop) => {
                                        return <tr>
                                            <td>{prop["name"]}</td>
                                            <td>{prop["nickname"]}</td>
                                            <td>{prop["code"]}</td>
                                            <td>{prop["accountNumber"]}</td>
                                            <td>{prop["balance"]}</td>
                                            <td>{prop["shippingProviderId"]}</td>
                                        </tr>
                                    })}
                                </tbody>
                            </Table>
                        </Row>
                    </Card.Body>
                </Card>
            </Container>
        )
    }
}

export default ListCarriers;
